{
	def mapSAPFee, mapRAPFee, mapCMMFee, mapSAPFeeTax, mapRAPFeeTax, mapCMMFeeTax, mapSAPFeeW, mapRAPFeeW, mapCMMFeeW, mapSAPFeeTaxW, mapRAPFeeTaxW, mapCMMFeeTaxW
